	/*========== Back to top ==========*/
	var offset = 300,
		scroll_top_duration = 700,
		$back_to_top = $('#back-to-top');

	$(window).scroll(function(){
		($(this).scrollTop() > offset) ? $back_to_top.removeClass('scale-out') : $back_to_top.addClass('scale-out');
	});

	$back_to_top.on('click', function(event){
		event.preventDefault();
		$('body,html').animate({scrollTop:0}, scroll_top_duration);
	});

	/*==========   ==========*/
	if(window.matchMedia('(min-width:601px)').matches) {
		var mainHeader = $('header'),
			secondaryNavigation = $('.fixed-nav'),
			headerHeight = (mainHeader.height() - 64),
			mainBlock = $('main');
			mainHeader.css('position','fixed');
			mainBlock.css('margin-top',''+mainHeader.height()+'px');
			$('#logo-img').addClass('responsive-img');

		var scrolling = false,
			previousTop = 0,
			currentTop = 0,
			scrollDelta = 10,
			scrollOffset = 150;

		$(window).on('scroll', function(){
			if(!scrolling) {
				scrolling = true;
				(!window.requestAnimationFrame)	? setTimeout(autoHideHeader, 250) : requestAnimationFrame(autoHideHeader);
			}
		});

		$(window).on('resize', function(){
			headerHeight = (mainHeader.height() - 64);
			mainBlock.css('margin-top',''+mainHeader.height()+'px');
			if(window.matchMedia('(max-width:600px)').matches) {
				mainBlock.css('margin-top','0px');
			}
		});

		function autoHideHeader() {
			var currentTop = $(window).scrollTop();
			checkSimpleNavigation(currentTop);
			previousTop = currentTop;
			scrolling = false;
		}

		function checkSimpleNavigation(currentTop) {
			if (previousTop - currentTop > scrollDelta) {
				mainHeader.removeClass('is-hidden');
			} else if(currentTop - previousTop > scrollDelta && currentTop > scrollOffset) {
				mainHeader.addClass('is-hidden');
			}
		}
	}

